import React, { useEffect, useState } from "react";
import './Students.scss'
import Sidebar from "../../../components/Sidebar/Sidebar";
import { AdvisorTabs } from "../../../constants/PageTabs/Manager";
import PageHead from "../../../components/General/PageHead/PageHead";
import axios from "axios";
import instance from "../../../axios";

export default function Students() {

    const [students, setStudents] = useState()
    useEffect(() => {
        async function getStudents() {
            const config = {
                withCredentials: true,
                headers: {
                    'Access-Control-Allow-Origin': '*',
                    'Content-Type': 'application/json'
                }
            }

            // const response = await axios.get('http://localhost:3001/advisor/students', config)
            const response = await instance.get('/advisor/students', config)
            setStudents(response.data)
            console.log(response.data)

        }
        getStudents()
    }, [])


    return (
        <>
            <div className="Students">
                <Sidebar pages={AdvisorTabs} current={'Students'} />
                <div>
                    <PageHead title={'Students'} />
                    <div className="content">

                        <table>
                            <thead>
                                <tr>
                                    <th>sl no.</th>
                                    <th>Photo</th>
                                    <th>Name</th>
                                    <th>Domain</th>
                                    <th>Week</th>
                                    <th>Scores</th>
                                    <th>Interviewer</th>
                                </tr>
                            </thead>
                            <tbody>
                                {students ?
                                    students.map((obj) => {
                                        return (
                                            <tr>
                                                <td>1</td>
                                                <td><img src="https://sunrift.com/wp-content/uploads/2014/12/Blake-profile-photo-square.jpg" alt="" /></td>
                                                <td>{obj.Name}</td>
                                                <td>{obj.Domain}</td>
                                                <td>Week</td>
                                                <td>5.6</td>
                                                <td>Subin</td>
                                            </tr>
                                        )
                                    })
                                    : null}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        </>
    )
}
